import { useState } from "react";

const Train = () => {
    const [ten, setTen] = useState<string>('');
    const [namsinh,setNamSinh] = useState<number>();
    return (<>
        <input type="text" name="ten" ></input>
        <input type="text" name="namsinh" ></input>
        <input type="button" name="check" value={'Tinh'}></input>
    </>)
}

export default Train;
